import React, {Component} from 'react';

class Aslide extends Component {
    render() {
        return (
            <div>
                <li className="activesld">
                    <div className="sliders">
                        <div className="image sl1" style={{backgroundImage: 'url("{this.props.anhnen}")'}}> </div>
                        <img src={this.props.link1} alt className="nd1" />
                        <img src={this.props.link1} alt className="nd2" />
                        <img src={this.props.link2} alt className="nt" />
                        <div className="content">
                            <small className="tt1"> {this.props.tieudeslide} </small>
                            <div className="decoration dc1" />
                            <p> {this.props.ndslide}</p>
                            <a className="more m1" href>See more... <i className="fas fa-caret-down" /></a>
                        </div>
                    </div>
                </li>
            </div>
        );
    }
}

export default Aslide;
